import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Simulate data exfiltration by accessing global JavaScript variables
    // This is a common technique for scraping data that is already loaded on the client-side
    const exfiltratedData = await page.evaluate(() => {
      // Access data from the global scope (window object) where the scripts have defined them
      const userProfile = window.junProfile;
      const orders = window.orderHistory;
      const products = window.allProducts;
      const reviews = window.junReviews;

      return {
        userProfile,
        orders,
        products,
        reviews
      };
    });

    // Take a screenshot after the data has been extracted (no visual change, but marks the step)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting user profile, order history, and product catalog directly from the page's JavaScript context.",
      extractedData: {
        username: exfiltratedData.userProfile.username,
        email: exfiltratedData.userProfile.email,
        totalOrdersExtracted: exfiltratedData.orders.length,
        totalProductsExtracted: exfiltratedData.products.length,
        totalReviewsExtracted: exfiltratedData.reviews.length,
        sampleOrder: exfiltratedData.orders[0] || null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
